import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';
import HomePage from './components/HomePage';
import ProductList from './components/ProductList';
import Login from './components/Auth/Login';
import Signup from './components/Auth/Signup';
import { CartProvider } from "./contexts/CartContext";
import Cart from './components/Cart/Cart';
import Checkout from './components/Cart/Checkout'; // ‚úÖ Import Checkout
import AdminPanel from './components/Admin/AdminPanel';
import ProtectedRoute from './components/ProtectedRoute';
import { useAuth } from './contexts/AuthContext';
import Dashboard from './components/Admin/Dashboard';
import Products from './components/Admin/Products';
import Orders from './components/Admin/Orders';
import Settings from './components/Admin/Setting';
import './app.css';
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

export default function App() {
  const { isLoggedIn, logout, user } = useAuth();

  const handleLogout = () => {
    logout();
    toast.success("Logout Successful!");
  };

  return (
    <CartProvider>
      <div>

        {/* --- TOP NAVBAR --- */}
        <nav className="navbar">
      <Link to="/" className="logo">GuruKrupa GiftArticle</Link>

      <div className="nav-links">
        <Link to="/products">Products</Link>

        {user ? (
          <>
            <span className="welcome-text">
              Welcome, {user.email}
            </span>

            <button className="logout-btn" onClick={handleLogout}>
              Logout
            </button>
          </>
        ) : (
          <>
            <Link to="/login" className="login-btn">Login</Link>
            <Link to="/signup" className="signup-btn">Signup</Link>
          </>
        )}
      </div>
    </nav>
  );

        <ToastContainer position="top-right" autoClose={2000} />

        {/* --- ROUTES --- */}
        <div className="page-container">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/products" element={<ProductList />} />
            <Route path="/login" element={<Login />} />
            <Route path="/signup" element={<Signup />} />
            <Route path="/cart" element={<Cart />} />
            <Route path="/checkout" element={<Checkout />} /> {/* ‚úÖ Checkout route */}

            {/* üîê Admin Only Routes */}
            <Route path="/admin" element={<ProtectedRoute><AdminPanel /></ProtectedRoute>}>
              <Route path="dashboard" element={<Dashboard />} />
              <Route path="products" element={<Products />} />
              <Route path="orders" element={<Orders />} />
              <Route path="settings" element={<Settings />} />
            </Route>
          </Routes>
        </div>

      </div>
    </CartProvider>
  );
}
